  <script>
  import HumCross from './HumCross.vue'
  export default {
    components: { HumCross },
        data() {
            return {
                notifi: false,
            }
        },
        methods: {
            closeNotify() {
                this.$session.set("notifi", "false");
                this.notifi = JSON.parse(this.$session.get("notifi")); 
            },
        },
        mounted() {
            this.$session.get("notifi") === "false" ? this.notifi = false : this.notifi = true; 
        },
  }
  </script>
  
  <style lang="scss">
      .header-notifi{
          top: 0;
          width: 100%;
          transition: 0.5s;
          display: flex;
          align-items: center;
          justify-content: center;
          gap: 40px;
          min-height: 44px;
          background-color: #131921;
          backdrop-filter: blur(2px);
          b{
              font-weight: 500;
              font-size: 16px;
              color: #FFFFFF;
              span{
                  color: #FF741F;
              }
          }
          .close{
              position: absolute;
              top: 50%;
              transform: translateY(-50%);
              right: 15px;
          }
          @media (max-width: 1200px) {
              padding: 0 50px;
              svg{
                  display: none;
              }
              b{
                  font-size: 14px;
                  padding: 5px 0;
                  text-align: center;
                  line-height: 18px;
              }
          }
      }
  </style>
